package pattern_pratice;

public class Double_continous_number {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int temp=1;
		
		for(int i=1;i<=5;i++) {
			for (int j=1;j<=5;j++) {
				System.out.print(temp+ " ");
				temp=temp+2;
			}
			System.out.println("");
		}

	}

}
